import React, {useEffect} from "react"
import {
    generateBatch,
    getState
 } from '../../endpoint/client';



const Dev = () =>{

    const generateBatchHandler = () =>{
        let newBatch =  {
            "numberOfDistricting" : 10,
            "name": "batch1",
            "isAvailable": false,
            "populationDifference": 10.0,
            "compactness": 10.0,
        }

        generateBatch(newBatch).then(data => {
            console.log(data); // JSON data parsed by `data.json()` call
          }).catch(error => {
              console.log(error)
          })

      }



    return(
        <div>
            <h1> Hello Devloper </h1>

            <button> Get State </button>
            <button onClick={generateBatch}> Generate Batch</button>

        </div>
    );
}

export default Dev;
